export default function Contact() {
  return (
    <section>
      <header className="major">
        <h2>Contact</h2>
      </header>
      <ul className="contact">
        <li className="fa-envelope-o">
          <a href="#">enrique.molinari@gmail.com</a>
        </li>
      </ul>
    </section>
  );
}
